"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[5974],{89586:(e,t,s)=>{s.r(t),s.d(t,{default:()=>r,johnChapter20ES:()=>o});const o={chapter:20,title:"Jean 20",version:"Reina-Valera 1909",language:"es",direction:"ltr",verses:[{number:1,text:"Y el primer d\xeda de la semana, Mar\xeda Magdalena vino de ma\xf1ana, siendo a\xfan obscuro, al sepulcro; y vi\xf3 la piedra quitada del sepulcro.",strong:[{text:"premier",strong:"G4413",start:3,end:10},{text:"jour",strong:"H3117",start:11,end:15},{text:"comme",strong:"G2531",start:84,end:89}]},{number:2,text:"Entonces corri\xf3, y vino \xe1 Sim\xf3n Pedro, y al otro disc\xedpulo, al cual amaba Jes\xfas, y les dice: Han llevado al Se\xf1or del sepulcro, y no sabemos d\xf3nde le han puesto.",strong:[{text:"disciple",strong:"G3101",start:46,end:54},{text:"Seigneur",strong:"G2962",start:116,end:124}]},{number:3,text:"Y sali\xf3 Pedro, y el otro disc\xedpulo, y vinieron al sepulcro.",strong:[{text:"disciple",strong:"G3101",start:18,end:26}]},{number:4,text:"Y corr\xedan los dos juntos; mas el otro disc\xedpulo corri\xf3 m\xe1s presto que Pedro, y lleg\xf3 primero al sepulcro.",strong:[{text:"primero",strong:"G4413",start:85,end:92}]},{number:5,text:"Y baj\xe1ndose \xe1 mirar, vi\xf3 los lienzos echados; mas no entr\xf3.",strong:[{text:"mirar",strong:"G3708",start:14,end:19}]},{number:6,text:"Lleg\xf3 luego Sim\xf3n Pedro sigui\xe9ndole, y entr\xf3 en el sepulcro, y vi\xf3 los lienzos echados,",strong:[{text:"dans",strong:"H6887",start:46,end:50},{text:"terre",strong:"H776",start:96,end:101}]},{number:7,text:"Y el sudario, que hab\xeda estado sobre su cabeza, no puesto con los lienzos, sino envuelto en un lugar aparte.",strong:[{text:"avec",strong:"G1848",start:58,end:62},{text:"dans",strong:"H6887",start:85,end:89}]},{number:8,text:"Y entonces entr\xf3 tambi\xe9n el otro disc\xedpulo, que hab\xeda venido primero al sepulcro, y vi\xf3, y crey\xf3.",strong:[{text:"primero",strong:"G4413",start:61,end:68}]},{number:9,text:"Porque aun no sab\xedan la Escritura, que era necesario que \xe9l resucitase de los muertos.",strong:[{text:"selon",strong:"G2531",start:40,end:45}]},{number:10,text:"Y volvieron los disc\xedpulos \xe1 los suyos.",strong:[]},{number:11,text:"Empero Mar\xeda estaba fuera llorando junto al sepulcro: y estando llorando, baj\xf3se \xe1 mirar el sepulcro;",strong:[{text:"mirar",strong:"G3708",start:83,end:88}]},{number:12,text:"Y vi\xf3 dos \xe1ngeles en ropas blancas que estaban sentados, el uno \xe1 la cabecera, y el otro \xe1 los pies, donde el cuerpo de Jes\xfas hab\xeda sido puesto.",strong:[{text:"cuerpo",strong:"G4561",start:110,end:116}]},{number:13,text:"Y dij\xe9ronle: Mujer, \xbfpor qu\xe9 lloras? D\xedceles: Porque se han llevado \xe1 mi Se\xf1or, y no s\xe9 d\xf3nde le han puesto.",strong:[{text:"Seigneur",strong:"G2962",start:92,end:100}]},{number:14,text:"Y como hubo dicho esto, volvi\xf3se atr\xe1s, y vi\xf3 \xe1 Jes\xfas que estaba all\xed; mas no sab\xeda que era Jes\xfas.",strong:[{text:"como",strong:"G2531",start:2,end:6},{text:"esto",strong:"G3778",start:18,end:22}]},{number:15,text:"D\xedcele Jes\xfas: Mujer, \xbfpor qu\xe9 lloras? \xbf\xe1 qui\xe9n buscas? Ella, pensando que era el hortelano, d\xedcele: Se\xf1or, si t\xfa lo has llevado, dime d\xf3nde lo has puesto, y yo lo llevar\xe9.",strong:[{text:"Seigneur",strong:"G2962",start:109,end:117}]},{number:16,text:"D\xedcele Jes\xfas: Mar\xeda. Volvi\xe9ndose ella, d\xedcele: Rabboni, que quiere decir, Maestro.",strong:[{text:"decir",strong:"H559",start:67,end:72},{text:"Maestro",strong:"G1320",start:74,end:81}]},{number:17,text:"D\xedcele Jes\xfas: No me toques: porque aun no he subido \xe1 mi Padre: mas ve \xe1 mis hermanos, y diles: Subo \xe1 mi Padre y \xe1 vuestro Padre, \xe1 mi Dios y \xe1 vuestro Dios.",strong:[{text:"Padre",strong:"G3962",start:57,end:62},{text:"Padre",strong:"G3962",start:106,end:111},{text:"Padre",strong:"G3962",start:124,end:129},{text:"Dios",strong:"G2316",start:136,end:140},{text:"Dios",strong:"G2316",start:153,end:157}]},{number:18,text:"Fu\xe9 Mar\xeda Magdalena dando las nuevas \xe1 los disc\xedpulos de que hab\xeda visto al Se\xf1or, y que \xe9l le hab\xeda dicho estas cosas.",strong:[{text:"Seigneur",strong:"G2962",start:65,end:73}]},{number:19,text:"Y como fue tarde aquel d\xeda, el primero de la semana, y estando las puertas cerradas donde los disc\xedpulos estaban juntos por miedo de los Jud\xedos, vino Jes\xfas, y p\xfasose en medio, y d\xedjoles: Paz \xe1 vosotros.",strong:[{text:"como",strong:"G2531",start:2,end:6},{text:"primero",strong:"G4413",start:31,end:38},{text:"miedo",strong:"H3372",start:124,end:129}]},{number:20,text:"Y como hubo dicho esto, mostr\xf3les las manos y el costado. Y los disc\xedpulos se gozaron viendo al Se\xf1or.",strong:[{text:"como",strong:"G2531",start:2,end:6},{text:"esto",strong:"G3778",start:18,end:22}]},{number:21,text:"Entonces les dijo Jes\xfas otra vez: Paz \xe1 vosotros: como me envi\xf3 el Padre, as\xed tambi\xe9n yo os env\xedo.",strong:[{text:"como",strong:"G2531",start:50,end:54},{text:"Padre",strong:"G3962",start:67,end:72}]},{number:22,text:"Y como hubo dicho esto, sopl\xf3, y d\xedjoles: Tomad el Esp\xedritu Santo:",strong:[{text:"como",strong:"G2531",start:2,end:6},{text:"esto",strong:"G3778",start:18,end:22}]},{number:23,text:"A los que remitiereis los pecados, les son remitidos: \xe1 quienes los retuviereis, ser\xe1n retenidos.",strong:[]},{number:24,text:"Empero Tom\xe1s, uno de los doce, que se dice el D\xeddimo, no estaba con ellos cuando Jes\xfas vino.",strong:[{text:"Thomas",strong:"G2381",start:0,end:6},{text:"avec",strong:"G1848",start:51,end:55}]},{number:25,text:"Dij\xe9ronle pues los otros disc\xedpulos: Al Se\xf1or hemos visto. Y \xe9l les dijo: Si no viere en sus manos la se\xf1al de los clavos, y metiere mi dedo en el lugar de los clavos, y metiere mi mano en su costado, no creer\xe9.",strong:[{text:"mano",strong:"G5495",start:181,end:185},{text:"creer",strong:"G4100",start:204,end:209}]},{number:26,text:"Y ocho d\xedas despu\xe9s, estaban otra vez sus disc\xedpulos dentro, y con ellos Tom\xe1s. Vino Jes\xfas, las puertas cerradas, y p\xfasose en medio, y dijo: Paz \xe1 vosotros.",strong:[{text:"nouveau",strong:"G2537",start:52,end:59},{text:"dans",strong:"H6887",start:60,end:64},{text:"maison",strong:"G3609",start:68,end:74},{text:"Thomas",strong:"G2381",start:79,end:85},{text:"avec",strong:"G1848",start:98,end:102},{text:"paix",strong:"G1515",start:186,end:190},{text:"avec",strong:"G1848",start:196,end:200}]},{number:27,text:"Luego dice \xe1 Tom\xe1s: Mete tu dedo aqu\xed, y ve mis manos: y alarga ac\xe1 tu mano, y m\xe9tela en mi costado: y no seas incr\xe9dulo, sino fiel.",strong:[{text:"mano",strong:"G5495",start:71,end:75}]},{number:28,text:"Entonces Tom\xe1s respondi\xf3, y d\xedjole: Se\xf1or m\xedo, y Dios m\xedo.",strong:[{text:"Dios",strong:"G2316",start:49,end:53}]},{number:29,text:"D\xedcele Jes\xfas: Porque me has visto, Tom\xe1s, creiste: bienaventurados los que no vieron y creyeron.",strong:[]},{number:30,text:"Y tambi\xe9n hizo Jes\xfas muchas otras se\xf1ales en presencia de sus disc\xedpulos, que no est\xe1n escritas en este libro.",strong:[{text:"este",strong:"G3778",start:99,end:103}]},{number:31,text:"Estas empero son escritas, para que cre\xe1is que Jes\xfas es el Cristo, el Hijo de Dios; y para que creyendo, teng\xe1is vida en su nombre.",strong:[{text:"Cristo",strong:"G5547",start:59,end:65},{text:"Hijo",strong:"G5207",start:70,end:74},{text:"Dios",strong:"G2316",start:78,end:82},{text:"vida",strong:"G2222",start:113,end:117},{text:"nombre",strong:"G3686",start:124,end:130}]}]},r=o}}]);
